import { Route, Routes } from 'react-router-dom';
import './App.css';
import Paperbase from './components/dashboard/Paperbase';

function App() {
  return (
    <div className="App">
       <Routes>
             <Route path="dashboard" element={<Paperbase/>}> 
                    <Route path='new' element={<NewPost />} /> {/*A nested route!*/}
                    <Route path=':postId' element={<Post />} /> {/*A nested route!*/} 
             </Route>
        </Routes>
    </div>
  );
}

export default App;
